import React from 'react';
import { motion } from 'framer-motion';

const Introduction = () => {
  const fadeIn = {
    initial: { opacity: 0, y: 20 },
    animate: { opacity: 1, y: 0 },
    transition: { duration: 0.6, ease: [0.22, 1, 0.36, 1] }
  };

  return (
    <section className="section pt-20 md:pt-32">
      <motion.div
        initial="initial"
        animate="animate"
        variants={{
          animate: { transition: { staggerChildren: 0.1 } }
        }}
        className="max-w-3xl"
      >
        <motion.h1 
          variants={fadeIn}
          className="text-display-lg font-bold text-text mb-6"
        >
          Data Scientist & ML Engineer
        </motion.h1>
        
        <motion.p 
          variants={fadeIn}
          className="text-body-lg text-text-light mb-8"
        >
          Passionate about leveraging data science and machine learning to solve complex problems. 
          Experienced in developing end-to-end ML solutions and data-driven applications. 
          Currently focused on advancing AI applications in healthcare and finance.
        </motion.p>

        <motion.div 
          variants={fadeIn}
          className="flex gap-4"
        >
          <a 
            href="#contact" 
            className="inline-flex items-center px-6 py-3 bg-primary text-white rounded-lg hover:bg-primary-dark transition-colors"
          >
            Get in Touch
          </a>
          <a 
            href="#projects" 
            className="inline-flex items-center px-6 py-3 bg-background-dark text-text rounded-lg hover:bg-gray-200 transition-colors"
          >
            View Projects
          </a>
        </motion.div>
      </motion.div>
    </section>
  );
};

export default Introduction;
